[include mainsail.cfg]
[include filament_change.cfg]
[include bed_mesh.cfg]
[include filament.cfg]
[exclude_object]
[include Macros.cfg]
[include SpeedTest.cfg]

[gcode_arcs]
resolution: 0.25
[endstop_phase]
[pause_resume]
[respond]

#[include ADXL345.cfg]
#[include ADXL345B.cfg]
#[include S2DW.cfg]

[virtual_sdcard]
path: /home/biqu/printer_data/gcodes

[idle_timeout]
timeout: 72000

[stepper_a]
step_pin: PE3
dir_pin: PE2
enable_pin: !PE4
microsteps: 32
rotation_distance: 40
endstop_pin: PA15
homing_speed: 30
#position_endstop: 299
#arm_length: 315
#angle: 210

[tmc2209 stepper_a]
uart_pin: PD5
sense_resistor: 0.110
run_current: 1.2
#stealthchop_threshold: 999999
interpolate: True

[stepper_b]
step_pin: PE0
dir_pin: PB9
enable_pin: !PE1
microsteps: 32
rotation_distance: 40
endstop_pin: PD2
homing_speed: 30
#position_endstop: 299
#arm_length: 315
#angle: 330

[tmc2209 stepper_b]
uart_pin: PD7
sense_resistor: 0.110
run_current: 1.2
#stealthchop_threshold: 999999
interpolate: True

[stepper_c]
step_pin: PB5
dir_pin: PB4
enable_pin: !PB8
microsteps: 32
rotation_distance: 40
endstop_pin: PC4
homing_speed: 30
#position_endstop: 299
#arm_length: 315
#angle: 90.000000

[tmc2209 stepper_c]
uart_pin: PD4
sense_resistor: 0.110
run_current: 1.2
#stealthchop_threshold: 999999
interpolate: True

[autotune_tmc stepper_a]
motor: flsun-v400-42
tuning_goal: silent

[autotune_tmc stepper_b]
motor: flsun-v400-42
tuning_goal: silent

[autotune_tmc stepper_c]
motor: flsun-v400-42
tuning_goal: silent

[autotune_tmc extruder]
motor: ldo-36sth20-1004ahg
tuning_goal: performance

[extruder]
step_pin: PD6
dir_pin: !PD3
enable_pin: !PB3
microsteps: 16
rotation_distance: 22.35 
gear_ratio: 50:10 
nozzle_diameter: 0.4
filament_diameter: 1.750
heater_pin: PE5
sensor_type: Generic 3950
sensor_pin: PC1
min_temp: -70
max_temp: 275
min_extrude_temp: 17
max_extrude_cross_section: 110 
max_extrude_only_distance: 1100

pressure_advance: 0.03
pressure_advance_smooth_time: 0.010

control: pid #220
pid_kp: 23.417
pid_ki: 1.007
pid_kd: 136.113


[verify_heater extruder]
check_gain_time: 120
heating_gain: 0.5

[input_shaper]
shaper_freq_x: 40.2
shaper_type_x: mzv
damping_ratio_x: 0.105
shaper_freq_y: 37.8
shaper_type_y: mzv
damping_ratio_y: 0.106

[tmc2209 extruder]
uart_pin: PD9
sense_resistor: 0.110
run_current: 0.800
#stealthchop_threshold: 999999
interpolate: True #false

[heater_bed]
heater_pin: PA0
sensor_type: EPCOS 100K B57560G104F
sensor_pin: PC0
min_temp: 0
max_temp: 115

control: pid
pid_kp: 71.679
pid_ki: 2.087
pid_kd: 615.546

[probe]
pin: !PC8
x_offset: 0
y_offset: 0
#z_offset: 22.135
speed: 10
samples: 3
samples_result: average
sample_retract_dist: 2
samples_tolerance: 0.02
samples_tolerance_retries: 5

[bed_mesh]
zero_reference_position: 0,0
algorithm: bicubic
speed: 50
horizontal_move_z: 24
mesh_radius: 130
mesh_origin: 0,0
round_probe_count: 21
mesh_pps: 3,3
fade_start: 2
fade_end: 10
split_delta_z: 0.025

[temperature_sensor Bed2]
sensor_pin: PA2
sensor_type: EPCOS 100K B57560G104F
min_temp: 0
max_temp: 120

[heater_fan nozzle_cooling_fan]
pin: PB0
max_power: 1.0
shutdown_speed: 0

[fan]
pin: PC14

[temperature_fan MCU]
pin: PB1
max_power: 1.0
min_temp: 0
max_temp: 100
kick_start_time: 0.5
off_below: 0.05
sensor_type: temperature_mcu
control: pid
pid_kp: 4.0
pid_ki: 1.0
pid_kd: 5.0
pid_deriv_time: 1.0
min_speed: 0.0
max_speed: 0.50
target_temp: 38

[filament_switch_sensor e0_sensor]
pause_on_runout: true
runout_gcode: 
  M600
switch_pin: PA4

[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32f407xx_2A0038000C51313339393731-if00

[printer]
kinematics: delta
max_velocity: 400
max_accel: 5000
square_corner_velocity: 5
max_z_velocity: 200
max_z_accel: 2000
#delta_radius: 155
print_radius: 135
minimum_z_position: -5

[delta_calibrate]
radius: 135
horizontal_move_z: 25
Speed: 20

[mcu host]
serial: /tmp/klipper_host_mcu

[temperature_sensor BTT-PI]
sensor_type: temperature_host

########################################
# EXP1 / EXP2 (display) pins
########################################

[board_pins]
aliases:
    # EXP1 header
    EXP1_1=PC5,  EXP1_3=PD13, EXP1_5=PE14, EXP1_7=PD11, EXP1_9=<GND>,
    EXP1_2=PE13, EXP1_4=PC6,  EXP1_6=PE15, EXP1_8=PD10, EXP1_10=<5V>,
    # EXP2 header
    EXP2_1=PA6, EXP2_3=PE8, EXP2_5=PE11, EXP2_7=PE12,  EXP2_9=<GND>,
    EXP2_2=PA5, EXP2_4=PE10, EXP2_6=PA7, EXP2_8=<RST>, EXP2_10=<3.3v>
    # Pins EXP2_1, EXP2_6, EXP2_2 are also MISO, MOSI, SCK of bus "ssp1"

[display]
lcd_type: uc1701
cs_pin: EXP1_3
a0_pin: EXP1_4
rst_pin: EXP1_5
contrast: 63
encoder_pins: ^EXP2_5, ^EXP2_3
click_pin: ^!EXP1_2
spi_bus: spi1

[pwm_cycle_time beeper]
pin: EXP1_1
value: 0
shutdown_value: 0
cycle_time: 0.0005 ; Default beeper tone in kHz. 1 / 0.0005 = 2000Hz (2kHz)

[neopixel btt_mini12864]
pin: EXP1_6
chain_count: 3
color_order: RGB
initial_RED: 0.09
initial_GREEN: 0.2
initial_BLUE: 0.5

